function onload()
  -- clickable area
  self.createButton({
      click_function="click", function_owner=self,
      position={0, 0.2, 0}, height=700, width=700, color={1,1,1,0}, label="", tooltip = self.getName()
  })
terminal = getObjectFromGUID('1456f8')

end

function click(object, player)
  self.AssetBundle.playTriggerEffect(0)
    local params = {}
    local fcn = self.getName()
    fcn = string.gsub(fcn, ' ', '')
    fcn = string.lower(fcn)
    terminal.call(fcn, {player})
end

